import React from "react";
import "./App.css";
import Header from "./components/Header";
import Container from "./components/Container";

function App() {
  function searchBooks(query) {
    searchQuery = query;
    return searchQuery;
  }

  return (
    <div className="App">
      <Header searchBooks={searchBooks} />
      <Container q={searchBooks} />
    </div>
  );
}

export default App;
